       // \u5185\u7f6e\u7684\u6837\u5f0f\u7c7b\u540d\u4e3a.m78-dnd-box\n                className={cls(\'m78-dnd-box\', {\n                  // \u7981\u7528\u3001\u62d6\u52a8\u5230\u4e2d\u95f4\u7684\u72b6\u6001\n                  __active: status.dragOver,\n                  __disabled: !enables.enable,\n                })}\n                style={style}\n              >\n                <div>3. \u4e0d\u9650\u5236\u65b9\u5411</div>\n              </div>\n            )}\n          </DND>\n\n          <DND\n            data="DND4"\n            enableDrop={(node, source) => {\n              return source?.data !== \'DND2\';\n            }}\n          >\n            {({ innerRef, status, enables }) => (\n              <div\n                ref={innerRef}\n                // \u5185\u7f6e\u7684\u6837\u5f0f\u7c7b\u540d\u4e3a.m78-dnd-box\n                className={cls(\'m78-dnd-box\', {\n                  // \u7981\u7528\u3001\u62d6\u52a8\u5230\u4e2d\u95f4\u7684\u72b6\u6001\n                  __active: status.dragOver,\n                  __disabled: !enables.enable,\n                })}\n                style={style}\n              >\n                <div>4. \u62d6\u52a8`2`\u65f6\u7981\u7528</div>\n              </div>\n            )}\n          </DND>\n        </Row>\n      </DNDContext>\n    </div>\n  );\n};\n\nexport default StatusDemo;\n',jsx:'import React from \'react\';\nimport DND, { DNDContext } from \'m78/dnd\';\nimport { Row } from \'m78/layout\';\nimport cls from \'classnames\';\n\nconst style = {\n  width: 140,\n  height: 140,\n  boxShadow: \'0 0 8px rgba(0,0,0,0.45)\',\n  display: \'flex\',\n  alignItems: \'center\',\n  justifyContent: \'center\',\n};\n\nconst StatusDemo = () => (\n  <div>\n    <DNDContext>\n      <Row mainAlign="evenly">\n        <DND\n          data="DND1"\n          enableDrop={{\n            left: true,\n            right: true,\n            bottom: true,\n            top: true,\n            center: true,\n          }}\n        >\n          {({ innerRef, status, enables }) => (\n            <div\n              ref={innerRef} // \u5185\u7f6e\u7684\u6837\u5f0f\u7c7b\u540d\u4e3a.m78-dnd-box\n              className={cls(\'m78-dnd-box\', {\n                // \u7981\u7528\u3001\u62d6\u52a8\u5230\u4e2d\u95f4\u7684\u72b6\u6001\n                __active: status.dragCenter,\n                __disabled: !enables.enable,\n              })}\n              style={style}\n            >\n              <div>1. \u5168\u65b9\u5411\u653e\u7f6e</div>\n\n              {/* \u62d6\u52a8\u5230\u4fa7\u8fb9\u65b9\u5411\u7684\u63d0\u793a */}\n              {status.dragLeft && <span className="m78-dnd-box_left" />}\n              {status.dragRight && <span className="m78-dnd-box_right" />}\n              {status.dragTop && <span className="m78-dnd-box_top" />}\n              {status.dragBottom && <span className="m78-dnd-box_bottom" />}\n            </div>\n          )}\n        </DND>\n\n        <DND\n          data="DND2"\n          enableDrop={{\n            bottom: true,\n            top: true,\n          }}\n        >\n          {({ innerRef, status, enables }) => (\n            <div\n              ref={innerRef} // \u5185\u7f6e\u7684\u6837\u5f0f\u7c7b\u540d\u4e3a.m78-dnd-box\n              className={cls(\'m78-dnd-box\', {\n                // \u7981\u7528\u3001\u62d6\u52a8\u5230\u4e2d\u95f4\u7684\u72b6\u6001\n                __active: status.dragCenter,\n                __disabled: !enables.enable,\n              })}\n              style={style}\n            >\n              <div>2. \u4e0a\u4e0b\u53ef\u653e\u7f6e</div>\n\n              {/* \u62d6\u52a8\u5230\u4fa7\u8fb9\u65b9\u5411\u7684\u63d0\u793a */}\n              {status.dragLeft && <span className="m78-dnd-box_left" />}\n              {status.dragRight && <span className="m78-dnd-box_right" />}\n              {status.dragTop && <span className="m78-dnd-box_top" />}\n              {status.dragBottom && <span className="m78-dnd-box_bottom" />}\n            </div>\n          )}\n        </DND>\n      </Row>\n\n      <Row mainAlign="evenly" className="mt-24">\n        <DND data="DND3" enableDrop>\n          {({ innerRef, status, enables }) => (\n            <div\n              ref={innerRef} // \u5185\u7f6e\u7684\u6837\u5f0f\u7c7b\u540d\u4e3a.m78-dnd-box\n              className={cls(\'m78-dnd-box\', {\n                // \u7981\u7528\u3001\u62d6\u52a8\u5230\u4e2d\u95f4\u7684\u72b6\u6001\n                __active: status.dragOver,\n                __disabled: !enables.enable,\n              })}\n              style={style}\n            >\n              <div>3. \u4e0d\u9650\u5236\u65b9\u5411</div>\n            </div>\n          )}\n        </DND>\n\n        <DND data="DND4" enableDrop={(node, source) => source?.data !== \'DND2\'}>\n          {({ innerRef, status, enables }) => (\n            <div\n              ref={innerRef} // \u5185\u7f6e\u7684\u6837\u5f0f\u7c7b\u540d\u4e3a.m78-dnd-box\n              className={cls(\'m78-dnd-box\', {\n                // \u7981\u7528\u3001\u62d6\u52a8\u5230\u4e2d\u95f4\u7684\u72b6\u6001\n                __active: status.dragOver,\n                __disabled: !enables.enable,\n              })}\n              style={style}\n            >\n              <div>4. \u62d6\u52a8`2`\u65f6\u7981\u7528</div>\n            </div>\n          )}\n        </DND>\n      </Row>\n    </DNDContext>\n  </div>\n);\n\nexport default StatusDemo;\n'}},{path:"/_demos/status-demo",dependencies:{classnames:"2.2.6"},files:{}}),o.a.createElement(m,null)),o.a.createElement("div",{className:"markdown"},o.a.createElement("h2",{id:"\u81ea\u52a8\u6eda\u52a8\u5d4c\u5957"},o.a.createElement("a",{"aria-hidden":"true",href:"#\u81ea\u52a8\u6eda\u52a8\u5d4c\u5957"},o.a.createElement("span",{className:"icon icon-link"})),"\u81ea\u52a8\u6eda\u52a8/\u5d4c\u5957"),o.a.createElement("p",null,"\u5f53\u62d6\u52a8\u5143\u7d20\u9760\u8fd1\u6216\u8d85\u8fc7\u4e00\u4e2a\u6eda\u52a8\u5bb9\u5668\u8fb9\u7f18\u65f6\uff0c\u4f1a\u81ea\u52a8\u671d\u5bf9\u5e94\u65b9\u5411\u6eda\u52a8\uff0c\u8d85\u51fa\u8fb9\u754c\u7684\u8ddd\u79bb\u8d8a\u5927\u6eda\u52a8\u8d8a\u5feb")),o.a.createElement(d.a,Object(a["a"])({source:{tsx:"import React, { useState } from 'react';\n\nimport { isString, swap } from '@lxjx/utils';\nimport { useFn } from '@lxjx/hooks';\nimport DND, { DragFullEvent, DNDContext } from 'm78/dnd';\nimport cls from 'classnames';\n\nimport sty from './board-demo.module.scss';\n\n/** \u680f\u76ee\u7684data\u7c7b\u578b */\ntype ColumnNodeData = {\n  name: string;\n  list: string[];\n};\n\n/** \u5f85\u529e\u9879\u7684data\u7c7b\u578b */\ntype TodoNodeData = {\n  list: string[];\n  item: string;\n};\n\nconst BoardDemo = () => {\n  /** todo\u6570\u636e\u6e90 */\n  const [todo, setTodo] = useState(() => [\n    {\n      name: 'Todo',\n      list: ['\ud83d\ude00', '\ud83d\ude01', '\ud83d\ude02', '\ud83e\udd23', '\ud83d\ude03', '\ud83d\ude04', '\ud83d\ude05', '\ud83d\ude06', '\ud83d\ude09', '\ud83d\ude0a', '\ud83d\ude0b'],\n    },\n    {\n      name: 'Progress',\n      list: ['\ud83d\ude0e'],\n    },\n    {\n      name: 'Completed',\n      list: ['\ud83d\ude0d', '\ud83d\ude18'],\n    },\n  ]);\n\n  /** \u68c0\u6d4b\u662f\u5426\u662fColumnNodeData */\n  function isColumn(data: any): data is ColumnNodeData {\n    if (!data) return false;\n    return isString(data.name);\n  }\n\n  /** \u653e\u7f6e\u4e8b\u4ef6\uff0c\u5728\u8fd9\u91cc\u540c\u6b65\u5217\u8868\u72b6\u6001, \u901a\u5e38\u4f1a\u5c06\u4e0d\u540c\u7684\u653e\u7f6e\u7c7b\u578b\u901a\u8fc7\u6b64\u51fd\u6570\u5206\u53d1\u5230\u4e0d\u540c\u7684\u5904\u7406\u51fd\u6570\u4e2d\uff0c\u8fd9\u91cc\u4f5c\u4e3a\u6f14\u793a\u90fd\u5199\u5728\u4e00\u8d77 */\n  const acceptHandle = useFn(\n    ({ target, source, status }: DragFullEvent<TodoNodeData, ColumnNodeData | TodoNodeData>) => {\n      // \u62d6\u52a8\u76ee\u6807\n      const sData = source?.data;\n      // \u653e\u7f6e\u76ee\u6807\n      const tData = target?.data;\n\n      if (!sData || !tData) return;\n\n      /* ######### \u653e\u7f6e\u76ee\u6807\u662f\u680f\u76ee #########  */\n      if (isColumn(tData)) {\n        // \u62d6\u52a8\u76ee\u6807\u4e5f\u662f\u680f\u76ee, \u4ea4\u6362\u5f7c\u6b64\u4f4d\u7f6e\n        if (isColumn(sData)) {\n          setTodo(prev => {\n            // \u67e5\u627e\u4e24\u8005\u7684\u5f53\u524d\u7d22\u5f15\n            const tInd = prev.findIndex(item => item.name === tData.name);\n            const sInd = prev.findIndex(item => item.name === sData.name);\n\n            // \u4ea4\u6362\u680f\u76ee\u4f4d\u7f6e\n            swap(prev, sInd, tInd);\n            // \u5982\u679c\u4e0d\u60f3\u4f7f\u7528\u5e93\u6765\u4ea4\u4e92\u5143\u7d20\u4f4d\u7f6e\uff0c\u53ef\u4ee5\u66ff\u6362\u6210\u4ee5\u4e0b\u4ee3\u7801\n            // prev.splice(tInd, 1, prev.splice(sInd, 1, prev[tInd])[0]);\n\n            return [...prev];\n          });\n          return;\n        }\n\n        // \u62d6\u52a8\u76ee\u6807\u662f\u5f85\u529e\u9879\uff0c\u5c06\u5176\u653e\u5230\u8be5\u680f\u76ee\u5e95\u90e8\n        const ind = sData.list.indexOf(sData.item);\n\n        if (ind !== -1) {\n          const removed = sData.list.splice(ind, 1);\n\n          tData.list.push(...removed);\n\n          // \u89e6\u53d1\u66f4\u65b0\n          setTodo(prev => [...prev]);\n        }\n        return;\n      }\n\n      /* ######### \u653e\u7f6e\u76ee\u6807\u662f\u5f85\u529e\u9879 #########  */\n      // \u67e5\u627e\u4e24\u8005\u7684\u5f53\u524d\u7d22\u5f15\n      const sInd = sData.list.indexOf(sData.item);\n      const tInd = tData.list.indexOf(tData.item);\n\n      if (sInd === -1 || tInd === -1) return;\n\n      // \u4ece\u5f53\u524d\u7ec4\u79fb\u9664\n      const removed = sData.list.splice(sInd, 1);\n\n      // \u63d2\u5165\u4f4d\u7f6e\n      let insertInd = tInd;\n\n      // \u65b9\u5411\u4e3a`bottom`\uff0c\u653e\u7f6e\u5230\u76ee\u6807\u4e0b\u65b9\uff0c\u5176\u5b83\u5747\u4e3a\u66ff\u6362\u5f53\u524d\u4f4d\u7f6e\n      if (status.dragBottom) {\n        insertInd += 1;\n      }\n\n      tData.list.splice(insertInd, 0, ...removed);\n\n      // \u89e6\u53d1\u66f4\u65b0\n      setTodo(prev => [...prev]);\n    },\n  );\n\n  return (\n    <div>\n      <DNDContext onAccept={acceptHandle}>\n        {todo.map(({ name, list }) => (\n          /* \u680f\u76ee */\n          <DND<ColumnNodeData>\n            key={name}\n            data={{\n              name,\n              list,\n            }}\n          >\n            {bonus => (\n              <div\n                // \u8bbe\u7f6e\u6302\u8f7d\u70b9\n                ref={bonus.innerRef}\n                className={cls(sty.column, 'm78-dnd-box', {\n                  // \u62d6\u52a8\u5230\u9876\u90e8\u65f6\u65f6\u8bbe\u7f6e\u9ad8\u4eae\n                  __active: bonus.status.dragOver,\n                })}\n              >\n                {/* \u8bbe\u7f6e\u6807\u9898\u90e8\u5206\u4e3a\u62d6\u52a8\u628a\u624b */}\n                <div ref={bonus.handleRef} className={sty.columnTitle}>\n                  {name}\n                </div>\n                <div className={sty.columnList}>\n                  {/* \u5f85\u529e\u9879\u5217\u8868 */}\n                  {list.map(todoItem => (\n                    <DND<TodoNodeData>\n                      key={todoItem}\n                      data={{\n                        list,\n                        item: todoItem,\n                      }}\n                      enableDrop={dragNode => {\n                        // \u5982\u679c\u62d6\u52a8\u76ee\u6807\u662f\u680f\u76ee\u3001\u7981\u6b62\u9632\u6b62\n                        if (isColumn(dragNode?.data)) return false;\n\n                        // \u5426\u5219\u8fd0\u884c\u9632\u6b62\u4e0a\u4e2d\u4e0b\u4e09\u4e2a\u4f4d\u7f6e\n                        return {\n                          top: true,\n                          bottom: true,\n                          center: true,\n                        };\n                      }}\n                    >\n                      {({ innerRef, status, enables }) => (\n     